Ok, let’s finally get around to writing HelloWorld: /// Prints "Hello world!".
fn main() { println!("Hello World!");
} You may be wondering: “What is that exclamation point doing at the end of that function name?” The answer is 'println!’ is not a normal function it is what is called a “Macro”. (Don't worry these aren't the horrifyingly unsafe macros of C and C++. Like most things in Rust they are designed to be safe.) You can think of macros as a function that does things that functions can't normally do. In this case ‘println’ supports string templates. fn main() { let name = "Ferris"; println!("Hello {}!", name);
} The template is validated at compile time. So if you were to type println!("Hello {}!"); or # let name = "a"; let name = "b"
println!("Hello {}!", name1, name2); the mistake would actually be a compile error. (BorrowChecker: Which is great because it means you can't write incorrect code. Optimizer: and has the added bonus of not spending any CPU at runtime parsing and verifying the template.) This kind of verification is something a normal function couldn't possibly do. Will get into how this implemented in a later chapter. But for now you should think of an elimination mark, as an alert that there's something unusual about that function and you should read its documentation.

