Besides being mutable or not, in Rust a variable can also be “borrowed”. When the parameter to a method is borrowed, it means the method promises not keep the parameter after the method has returned. Or anything it obtained from the parameter. A method that takes a borrowed parameter cannot assign the parameter to a member variable. Also it can only pass that parameter to other methods which also borrow it. (Otherwise it would be able violate its contract indirectly.) Safety monitor: “I will act as the borrow checker to make sure you don't make a mistake.” To indicate a parameter is borrowed, in the method signature, place a “&” in front of the type. As an example, in Java you might define a method 'isSorted’ like this boolean isSorted(List<Integer> values); that returns a boolean indicating if a list is sorted. In Rust you would add an ‘&’ in front of the type in the method signature to indicate that it will not retain any references to the list or it's contents when the method returns. # trait Example {
fn isSorted(values: & Vec<i32>) -> bool;
# } It is helpful to think of 'borrowed’ as being part of the type. IE “The method takes a borrowed list.” This declaration provides a strong and useful guarantee to the callers of a method. But it would be worthless if in a newer version, the method just deleted the ‘&’ from it's signature and removed the guarantee. To prevent this, and to make the guarantee explicit in the caller's code, when a method is being invoked; When a method that borrows a parameter is invoked, the caller puts an ‘&’ in front of the variable name being passed in. For example # fn isSorted(values: & Vec<i32>) -> bool { true }
# let values = vec![1, 2, 3];
if (isSorted(&values)) { //...
} This is only needed if the variable being passed isn't itself borrowed. (Otherwise it would be redundant, because it can only pass it to methods which borrow it.) Passing a parameter to a method that borrows is sometimes referred to a the parameter being “lent” to the method.
